import React from 'react'
import './card.css'



function Card(props) {
        return (
            <div>
                <p>{ this.props.city }</p> 
                <p>{ this.props.country }</p>
                <p>{ this.props.localtime }</p>
                <img alt="icon" src={ this.props.weather_icons } />
                <p>{ this.props.temperature }</p>
                <p>{ this.props.weather_descriptions }</p>
            </div>
        )
    
}

export default Card;
